const ItemList = ({ items }) => {
  console.log("items: ", items);
  return (
    <div>
      {items.map((item) => {
        return (
          <div>
            <div>
              <span>{item.card.info.name}</span>
              <span>{item.card.info.price}</span>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default ItemList;
